import numpy as np
import pandas as pd
import matplotlib.pyplot as plt
from sklearn.preprocessing import MinMaxScaler
from tensorflow.keras.models import Sequential
from tensorflow.keras.layers import Dense, LSTM, GRU, Dropout
from sklearn.metrics import mean_squared_error

"""#Load and Preprocess the AirPassengers Dataset"""

# Load dataset
df = pd.read_csv('AirPassengers.csv')
df.columns = ["Month", "Passengers"]
df.drop("Month", axis=1, inplace=True)

# Normalize the dataset
scaler = MinMaxScaler()
data = scaler.fit_transform(df)

# Function to create sequences
def create_sequences(data, seq_len):
    X, y = [], []
    for i in range(len(data) - seq_len):
        X.append(data[i:i + seq_len])
        y.append(data[i + seq_len])
    return np.array(X), np.array(y)

# Create sequences
seq_len = 10
X, y = create_sequences(data, seq_len)

# Split into train and test sets
split = int(len(X) * 0.8)
X_train, X_test = X[:split], X[split:]
y_train, y_test = y[:split], y[split:]

"""#Build and Train the LSTM Model with Epoch=50 batch_size=4"""

# Build LSTM model
lstm_model = Sequential([
    LSTM(50, activation='relu', input_shape=(seq_len, 1)),
    Dense(1)
])
lstm_model.compile(optimizer='adam', loss='mse')

# Train LSTM
lstm_model.fit(X_train, y_train, epochs=50, verbose=1,batch_size=4)

"""![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)

#Build and Train the GRU Model with Epoch=50, batch_size=4
"""

# Build GRU model
gru_model = Sequential([
    GRU(50, activation='relu', input_shape=(seq_len, 1)),
    Dense(1)
])
gru_model.compile(optimizer='adam', loss='mse')

# Train GRU
gru_model.fit(X_train, y_train, epochs=50, verbose=1, batch_size=4)

"""![image.png](data:image/png;base64,)

#Evaluate and Compare the Models
"""

# Predict and inverse transform
lstm_pred = scaler.inverse_transform(lstm_model.predict(X_test))
gru_pred = scaler.inverse_transform(gru_model.predict(X_test))
y_true = scaler.inverse_transform(y_test)

# Calculate RMSE
lstm_rmse = np.sqrt(mean_squared_error(y_true, lstm_pred))
gru_rmse = np.sqrt(mean_squared_error(y_true, gru_pred))

print(f"LSTM RMSE: {lstm_rmse:.2f}")
print(f"GRU RMSE: {gru_rmse:.2f}")

"""#Visualize the Predictions"""

plt.figure(figsize=(12,6))
plt.plot(y_true, label='Actual')
plt.plot(lstm_pred, label='LSTM Prediction')
plt.plot(gru_pred, label='GRU Prediction')
plt.legend()
plt.title('LSTM vs GRU Predictions')
plt.show()

